// Load template APIs
const copyFromWindow = require('copyFromWindow');
const createQueue = require('createQueue');
const injectScript = require('injectScript');
const log = require('logToConsole');
const Math = require('Math');

const dataLayerPush = createQueue('dataLayer');

// Fix version to avoid surprises when the dist is updated
const VERSION = '5.0.1';

// Helper for failure handling
const fail = msg => {
  log(msg);
  data.gtmOnFailure();
};

const getDebugTarget = (obj) => {
  if (!obj.attribution) {
    return undefined;
  }
  switch(obj.name) {
    case 'CLS':
      return obj.attribution.largestShiftTarget;
    case 'INP':
      return obj.attribution.interactionTarget;
    case 'LCP':
      return obj.attribution.element;
  }
};

// Process the web vitals object and push to dataLayer
const process = obj => {
  const dlObj = {event: 'coreWebVitals', webVitalsMeasurement: {}};
  const cwvObj = {
    name: obj.name,
    id: obj.id,
    value: obj.value,
    delta: obj.delta,
    valueRounded: Math.round(obj.name === 'CLS' ? obj.value * 1000 : obj.value),
    deltaRounded: Math.round(obj.name === 'CLS' ? obj.delta * 1000 : obj.delta),
    rating: obj.rating,
    navigationType: obj.navigationType    
  };

  if (data.attribution) {
    const debugTarget = getDebugTarget(obj);
    if (typeof debugTarget !== 'undefined') {
      cwvObj.debugTarget = debugTarget;
    }
    if (obj.attribution.loadState) cwvObj.loadState = obj.attribution.loadState;
  }
  if (data.namespace) {
    // If namespaced, add the measurement under the name of the measurement
    dlObj.webVitalsMeasurement[obj.name] = cwvObj;
  } else {
    // If not namespaced, add the measurement directly into webVitalsMeasurement
    dlObj.webVitalsMeasurement = cwvObj;
  }
  dataLayerPush(dlObj);
};

// Set the handlers
const setMilestones = () => {
  const wv = copyFromWindow('webVitals');
  if (!wv) return fail('[GTM / Core Web Vitals]: window.webVitals failed to load.');
  wv.onINP(process);
  wv.onCLS(process);
  wv.onLCP(process);
  if (data.allMetrics) {
    wv.onFCP(process);
    wv.onTTFB(process);
  }
  data.gtmOnSuccess();
};

// Load the library
const scriptSuffix = data.attribution ? '.attribution.iife.js' : '.iife.js';
injectScript('https://unpkg.com/web-vitals@' + VERSION + '/dist/web-vitals' + scriptSuffix, setMilestones, data.gtmOnFailure, 'web-vitals');


